import AccountBalanceIcon from "@mui/icons-material/AccountBalance";
import CoPresentIcon from "@mui/icons-material/CoPresentIcon";
import SchoolIcon from "@mui/icons-material/SchoolIcon";
import MeetingRoomIcon from "@mui/icons-material/MeetingRoomIcon";
import ListAltIcon from "@mui/icons-material/ListAltIcon";
import FunctionsIcon from "@mui/icons-material/FunctionsIcon";
import HowToRegIcon from "@mui/icons-material/HowToRegIcon";
import DashboardIcon from "@mui/icons-material/DashboardIcon";

const Menu = [
  {
    icon: <AccountBalanceIcon />,
    text: "Maktab",
  },
  {
    icon: <CoPresentIcon />,
    text: "O'qituvchilar",
  },
  {
    icon: <SchoolIcon />,
    text: "O'quvchilar",
  },
  {
    icon: <MeetingRoomIcon />,
    text: "Sinflar",
  },
  {
    icon: <ListAltIcon />,
    text: "Jurnal",
  },
  {
    icon: <FunctionsIcon />,
    text: "Fanlar",
  },
  {
    icon: <HowToRegIcon />,
    text: "Xonalar",
  },
  {
    icon: <DashboardIcon />,
    text: "Dars jadvali",
  },
];

export default menu;
